import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import Navigation from "./Navigations/Navigation";
import AppRoutes from "../AppRoutes";

function App() {
  return (
    <Router>
      <div className="app-container">
        <Navigation />
        <AppRoutes />
      </div>
    </Router>
  );
}

export default App;
